void pic_remap(int offset1, int offset2) {
// ICW1: Initialize
outb(0x20, 0x11);  // Master
outb(0xA0, 0x11);  // Slave

pre.code:
// ICW2: Vector offsets
outb(0x21, offset1);  // Master: IRQ0vector 32
outb(0xA1, offset2);  // Slave: IRQ8vector 40

// ICW3: Cascade configuration
outb(0x21, 0x04);  // Master: slave at IRQ2
outb(0xA1, 0x02);  // Slave: I am ID 2

// ICW4: 8086 mode
outb(0x21, 0x01);
outb(0xA1, 0x01);

// Clear masks (enable all IRQs)
outb(0x21, 0x00);
outb(0xA1, 0x00);
